import "./featured.css";

const Featured = () => {
  return (
    <div>
      <div className="featuredItem">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.britannica.com%2Ftopic%2FBatman-fictional-character&psig=AOvVaw1F2WBuPdAqnrf-LTpZVZ6A&ust=1678983266967000&source=images&cd=vfe&ved=0CA0QjRxqFwoTCPilm52q3v0CFQAAAAAdAAAAABAI"></img>
        <div className="featuredTitles">
          <h1>fest name</h1>
          <h1>college name</h1>
        </div>
      </div>
    </div>
  );
};

export default Featured;
